import React, { Component } from "react";

class eu extends Component {
  render() {
    return <div>
      <h1>Gabriel Wanguesltel</h1>
      <p> Eu sou um menino pequeno, que ama programar e rolar dados(rpg de mesa)</p>
    </div>
  }
}

export default eu;
